(1, 'EVNT-1733838828-1835', ' Debate Competition', 'Almost five months ago, the University of the Philippines Debate Society (UPDS) hosted the National Debate Championship Diliman. Then, we were fighting for our desired future, one in which democracy and truth prevail.\r\n\r\nWe did not succeed, our worst fears were realized, and our future as a nation seems bleak. These are dark and trying times. Nevertheless, we will forge ahead.\r\n\r\nAmid the corruption, disinformation, and abuses of power, we will continue to exercise our freedom of thought and expression. On behalf of the Board of Directors, the UPDS, and all our partners, I hope you join us in the 20th Philippine Intercollegiate Debating Championship.', '2024-12-12', '', '', '', '', '10:57:44', '11:00:00', , '2024-12-12', NULL, NULL, 1);

